const httpClient = axios.create({
    baseURL: 'http://localhost:8080'
})

class ApiService{
    constructor(apiurl){
        this.apiurl = apiurl        
    }

    post(url, objeto){
        //return httpClient.post(url,objeto)
        const requestUrl = `${this.apiurl}${url}`
        return httpClient.post(requestUrl, objeto)
    }

    put(url, objeto){
        return httpClient.put(url,objeto)
        //const requestUrl = `${this.apiurl}${url}`
